description:
Au Dela du Miroir (Michael D'Angelo, Marc Dorcel / Classic / 1993)

La somptueuse Julia Channel est la grande vedette de cette histoire extraordinaire avec du sexe haut de gamme, de la domination, des grosses poitrines, du lesbianisme et des amours de groupe. Cette coproduction franco-allemande apporte un style nouveau pour amateurs de sensations fortes. 

Julia Channel, Nitteta , Dylan , Barbara Doll, Backey Jakic, Mamy Moore,
Cindy Power, Peter Ryan, Maris Von Bellden

Classic, Retro

